import React, { Component } from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div><i class="fas fa-map-marker"></i>{text}</div>;
class Maps extends Component {
    static defaultProps = {
        center: {
            lat: 34.747847,
            lng: 10.766163
        },
        zoom: 11
    };

    // componentDidMount() {
    //     var idClient = this.props.location.state.idClient;
    //     axios.get(process.env.REACT_APP_API_URL + 'Back_hooda/GetAdresseByClientId.php?id=' + idClient).then(res => {
    //         this.setState({
               
    //         })
    //     })
    // }

    render() {
        return (
            <div style={{ height: '100vh', width: '100%' }}>
                <GoogleMapReact
                    bootstrapURLKeys={{ key: 'AIzaSyAhL4D_X4dhl-AW1E9HvG2k657SdqOEwEA' }}
                    defaultCenter={this.props.center}
                    defaultZoom={this.props.zoom}
                >
                    <AnyReactComponent
                        lat={34.747847}
                        lng={10.766163}
                        text="Adresse"
                    />
                </GoogleMapReact>
            </div>
        );
    }
}

export default Maps;
